import './navbarBottom.css'
import {AiOutlineInstagram} from 'react-icons/ai';
import {TbBrandTelegram} from 'react-icons/tb';
import {FaWhatsapp} from 'react-icons/fa';
import {FaLinkedin} from 'react-icons/fa';
import {FiTwitter} from 'react-icons/fi';


const NavbarBottom = () => {
    return ( 
        <>
              <div className="container-fluid sec2">
                <div className="row row2">
                    <div className="col-xl-5 col-lg-4 col-6 my-group-col">
                        <div className="socials">
                            <ul className="socials-list">
                                <li className="socials-list-item"><AiOutlineInstagram/></li>
                                <li className="socials-list-item navBottom-socials-item-hide"><TbBrandTelegram/></li>
                                <li className="socials-list-item"><FaWhatsapp/></li>
                                <li className="socials-list-item navBottom-socials-item-hide"><FaLinkedin/></li>
                                <li className="socials-list-item navBottom-socials-item-hide"><FiTwitter/></li>
                            </ul>
                        </div>
                    </div>
                    <div className="col-xl-7 col-lg-8 col-10 my-group-col">
                        <div className="nav-groups">
                            {/* <ul className="groups-list">
                                <li className="groups-list-item">دسته بندی 1</li>
                                <li className="groups-list-item">دسته بندی 2</li>
                                <li className="groups-list-item">دسته بندی 3</li>
                                <li className="groups-list-item">دسته بندی 4</li>
                                <li className="groups-list-item">دسته بندی 5</li>
                            </ul> */}
                            <div className="all-groups navBottom-allgroups-visible">دسته بندی ها</div>
                        </div>
                    </div>
                </div>
            </div>
        </>
     );
}
 
export default NavbarBottom;
